18. She Fancies Herself a Lady
19. Weather Man
20. Half Past Midnight [Mono 45]

 Originally known as The Staccatos, Ottawa, Canada's Five Man Electrical Band launched onto the scene in 1969 with this criminally underrated, psychedelically tinged pop gem. Reminiscent of the Beatles, The Beach Boys, The Zombies, The Hollies...

 Eventually, the band developed into one of Canada's best-known groups, and later achieved worldwide fame via their 1971 anti-establishment anthem, &quot; Signs. &quot;

 This first-ever CD issue of their long-out-of-print Capitol LP is supplemented by rare Staccatos 45s, none of which have ever been issued on CD.

